import React from 'react';

class ImageCard extends React.Component {
    render() {
        const { alt_description, urls } = this.props.image;

        return (
            <div className="image-card">
                <img 
                    alt={alt_description}
                    src={urls.regular}
                />
            </div>
        );
    }
}

export default ImageCard;
